(defn simulate-points
  [{:keys [alpha beta] :or {alpha 0 beta 0}}]
  (when (and (pos? alpha) (pos? beta))
    (r/sample 100 #_(+ alpha beta) (r/beta {:alpha alpha :beta beta}))))

(defn simulate
  [data]
  (mapcat (fn [[cy vs]]
            (mapcat (fn [[ay beta]]
                      (for [y (simulate-points beta)]
                        {:year cy :x ay :y y}))
                    vs))
          data))

(defn to-proportion
  [data]
  (mapcat (fn [[cy vs]]
            (mapcat (fn [[ay {:keys [alpha beta] :or {alpha 0 beta 0}}]]
                      (when (and (pos? alpha) (pos? beta))
                        [{:year cy :x ay :y (double (/ alpha (+ alpha beta)))}]))
                    vs))
          data))

(defn scatter-plot [x y data]
  (when (seq data)
    (let [df (seq-of-maps->data-frame data)]
    (gg4clj/view [[:require :mgcv]
                  [:<- :dat (gg4clj/data-frame df)]
                (gg4clj/r+ 
                  [:ggplot :dat [:aes {:x x :y y :colour [:factor :year]}]]
                  [:geom_point {:size 0.1 #_:position #_"jitter"}]
                  #_[:geom_smooth]
                  [:stat_smooth {:method "gam" :size 1 :formula [:as.formula "y ~ s(x, k = 15)"]}])]))))


(->> (rollup-alpha-beta-by (juxt :calendar-year :academic-year-1) mover? (remove leaver? (remove joiner? (get-transitions))))
     (simulate)
	 (scatter-plot :x :y))
