;; Heatmap

(defn log [x] (Math/log x))

(defn heatmap [{:keys [title]} data]
    (gg4clj/view [[:<- :dat (gg4clj/data-frame data)]
                (gg4clj/r+ 
                  [:ggplot :dat [:aes :x :y]]
                  [:ggtitle title]
                  [:geom_tile [:aes {:fill :v}] {:color "white"}]
                  [:scale_fill_gradient {:low "white" :high "steelblue"}]
                  [:theme {:axis.text.x [:element_text {:angle 330}]}])]))

(defn densify [data]
  (when (seq data)
    (let [[xs ys] (apply map vector (keys data))
        xs (sort (distinct xs))
        ys (sort (distinct ys))]
    (->> (for [x xs y ys] (vector x y))
         (reduce (fn [coll [x y]]
                   (assoc coll [x y] (get data [x y] 0)))
                 {})))))

(for [academic-year (range -3 18)]
  (let [data (->> (get-transitions)
                  (filter #(= (:academic-year-1 %) academic-year)))
        totals (reduce (fn [coll {:keys [setting-1 setting-2]}]
                              (update coll setting-2 u/some+ 1))
                       {} data)]
    (some->> (filter mover? data)
             (reduce (fn [coll {:keys [setting-1 setting-2]}]
                       (update coll [setting-1 setting-2] u/some+ 1))
                     {})
             (map (fn [[[k1 k2] v]]
                    (let [t (get totals k1 0)]
                      (vector (name k1) (name k2) v))))
             (seq)
             (apply map vector)
             (zipmap [:x :y :v])
             (heatmap {:title (str "Raw " academic-year)}))))

(for [academic-year (range -3 18)]
  (let [data (->> (get-transitions)
                  (filter #(= (:academic-year-1 %) academic-year)))
        totals (reduce (fn [coll {:keys [setting-1 setting-2]}]
                              (update coll setting-2 u/some+ 1))
                       {} data)]
    (some->> (filter mover? data)
             (reduce (fn [coll {:keys [setting-1 setting-2]}]
                       (update coll [setting-1 setting-2] u/some+ 1))
                     {})
             (densify)
             (map (fn [[[k1 k2] v]]
                    (let [t (get totals k1 0)]
                      (vector (name k1) (name k2) (inc v)))))
             (seq)
             (apply map vector)
             (zipmap [:x :y :v])
             (heatmap {:title (str "Smoothed " academic-year)}))))


