  (let [data (->> (get-transitions) (remove leaver?) (filter #(= (:calendar-year %) 2016)) (filter mover?))
        totals-x (reduce (fn [coll {:keys [setting-1]}]
                              (update coll (name setting-1) u/some+ 1))
                       {} data)
        total (count data)
        totals-y (reduce (fn [coll {:keys [academic-year-1]}]
                              (update coll academic-year-1 u/some+ 1))
                       {} data)]
    (println total)
    (println totals-x)
    (println totals-y)
    (some->> (filter mover? data)
             (reduce (fn [coll {:keys [setting-1 academic-year-1]}]
                       (update coll [(name setting-1) academic-year-1] u/some+ 1))
                     {})
             (densify)
             (map (fn [[[k1 k2] v]]
                     (let [t1 (get totals-x k1 0)
                           t2 (get totals-y k2 0)]
                       (vector k1 k2 (/ (* t1 t2) total)))))
             (seq)
             (apply map vector)
             (zipmap [:x :y :v])
             (heatmap {:title (str "Smoothed")})))
  
