#_(for [academic-year (range -2 16)]
  (some->> (filter mover? (get-transitions))
       #_(filter #(= (:academic-year-1 %) academic-year))
     (reduce (fn [coll {:keys [setting-1 setting-2]}]
               (update coll [setting-1 setting-2] u/some+ 1))
             {})
           (vals)
))

(defn histogram
  [{:keys [title]} data]
  (gg4clj/view [[:<- :dat (gg4clj/data-frame (seq-of-maps->data-frame data))]
                (gg4clj/r+ 
                  [:ggplot :dat [:aes :x]]
                  [:geom_histogram]
                  [:ggtitle title])]))

 (for [academic-year (range -2 16)]
   (some->> (filter mover? (get-transitions))
     (reduce (fn [coll {:keys [setting-1 setting-2]}]
               (update coll [setting-1 setting-2] u/some+ 1))
             {})
          (densify)
           (vals)
          (map #(hash-map :x %))
          (histogram {:title "Histogram"})
    )

